export default function Admin() {
  return (
      <div className="container">
        <div className="header">Admin</div>
        <div className="content_box">form</div>
    <style jsx>{`
        .container{
            height:100%;
        }
        .header{
            height:28px;
            padding:8px;
            background-color:#006; 
            color:#FFF;
        }
        .content_box{
            height:calc(100% - 60px);
            padding:8px;
        }
    `}</style>
      </div>
  );
}
